DROP TABLE IF EXISTS `upms_department`;
CREATE TABLE `upms_department` (
  `id` varchar(32) NOT NULL COMMENT '行号',
  `dept_name` varchar(30) NOT NULL COMMENT '部门名称',
  `dept_level` int(11) NOT NULL COMMENT '节点级别 0为根节点 1:一级节点 1:二级节点',
